INSERT INTO `questions` VALUES (1,'Стараюсь стать более разумным, гармоничным '),(2,'Доброжелательно отношусь к большинству людей '),(3,'Веду здоровый и разнообразный образ жизни '),(4,'Сохраняю контроль над эмоциями в сложных жизненных ситуациях '),(5,'Обычно я внимательно слушаю другого, не теряя нити его размышлений '),(6,'Всегда говорю только правду '),(7,'Стараюсь гибко управлять своими эмоциями и действиями'),(8,'Стремлюсь к достаточно высоким, но не к максимальным достижениям'),(9,'Преимущественно опираюсь на себя в жизни, а не на внешние обстоятельства '),(10,'Я удовлетворен жизнью в целом '),(11,'Я понимаю, к чему больше всего предназначен в жизни '),(12,'Мои главные жизненные планы осуществлялись в ближайший год так, как было намечено '),(13,'В целом у меня положительное представление о себе '),(14,'Для меня важно развивать разные стороны своего характера '),(15,'Принимаю двойственность Мира, наличие в нем и светлого, и темного '),(16,'Сочетаю в своём образе жизни умственные и физические занятия '),(17,'Импульсивно, бесконтрольно проявляю свои эмоции '),(18,'Я всегда прекрасно выгляжу '),(19,'Стараюсь культурно, приемлемо для других людей выражать свои негативные эмоции '),(20,'Я беззаботно отношусь к своему здоровью '),(21,'Проявляю чувство меры в своих желаниях и ожиданиях '),(22,'Самостоятельно ищу причины явлений, их суть '),(23,'Удовлетворен отношениями в семье '),(24,' Я определил, что карьера для меня важнее, чем семья '),(25,'Я доволен уровнем моих успехов и достижений '),(26,'Верю, что мне удастся выполнить моё предназначение '),(27,'Стремлюсь жить полной, гармоничной жизнью '),(28,'Я чувствую красоту природы '),(29,'Стараюсь больше времени проводить на природе '),(30,'Проявляю волю для осуществления намеченных целей и планов '),(31,'Быстро начинаю раздражаться в ходе общения с людьми '),(32,'Создаю у себя положительный настрой на предстоящий день '),(33,'Мои желания и представления обычно разумны, реалистичны '),(34,'Мой жизненный путь больше зависит от внешних обстоятельств '),(35,'Доволен отношениями с друзьями '),(36,'Я определил свои жизненные задачи на ближайшие несколько лет '),(37,'Регулярно работаю над осуществлением своих целей '),(38,'Я достаточно самокритичен, вижу у себя и плюсы, и минусы '),(39,' Мне всегда удается убедить в своей правоте любого собеседника '),(40,'У меня широкий круг разнообразных интересов '),(41,'Уважаю других людей и стараюсь помогать им '),(42,'Охотно общаюсь с лицами противоположного пола '),(43,'Нахожу психологические причины своего настроения, своих ошибок '),(44,'В спорных ситуациях стараюсь проявлять гибкость, иду на сотрудничество или компромисс '),(45,'С возрастом я становлюсь уравновешеннее, спокойнее '),(46,'У меня спокойные, умеренно выраженные темперамент и характер '),(47,'Считаю себя хозяином своей судьбы '),(48,'Удовлетворен отношениями на работе (в учебной группе) '),(49,'Сочувствие и отзывчивость присущи моему характеру '),(50,'У меня не бывает минут сильного волнения'),(51,'Практически осуществляю свои новые идеи, создаю новые творческие продукты '),(52,'Мне присущи оптимизм и жизнерадостность '),(53,'Мои душа и тело составляют единое целое '),(54,'Стараюсь находить время для творческой деятельности '),(55,'Комфортно чувствую себя как в компании, так и в уединении '),(56,'Сохраняю спокойную речь и ясную голову в большинстве конфликтных ситуаций '),(57,'Стараюсь точно выполнять обещания и деловые соглашения '),(58,'Развиваю свои физические качества: гибкость, выносливость, силу'),(59,'С возрастом я становлюсь умереннее и реалистичнее в желаниях '),(60,'В жизни я больше опираюсь на других людей, чем на себя '),(61,'В целом принимаю себя таким, какой я есть '),(62,'Я могу определить, каким стану через 5 лет '),(63,'У меня есть достижения в разных сферах жизни '),(64,'Обычно ясно и уверенно высказываю свои мысли '),(65,'Стараюсь жить в согласии с собой и окружающим миром '),(66,'Я люблю природу и бережно отношусь к ней '),(67,'Избегаю физических нагрузок и упражнений '),(68,'Потакаю всем своим желаниям, не ограничивая их силу '),(69,'Думаю, что большинство людей хорошо ко мне относится '),(70,'С возрастом я становлюсь гармоничнее '),(71,'Никогда не переношу на завтра то, что могу сделать сегодня '),(72,'Я самостоятелен в принятии решений '),(73,'Нахожу в себе значительные неразрешённые противоречия '),(74,'В изменчивом мире я сохраняю свои жизненные ценности '),(75,'Уверен в своих возможностях и силах осуществить планы '),(76,'Чувствую внутреннее единство со всей живой природой '),(77,'Ценю красоту поступков и мыслей людей '),(78,'Удовлетворяю в первую очередь свои желания, не обращая внимания на интересы других людей '),(79,'Довожу важные дела до конца, отдавая силы в основном главным целям '),(80,'С возрастом я становлюсь добрее '),(81,'Занимаюсь саморазвитием своих моральных и волевых качеств '),(82,'Я доволен тем, как осуществляются мои потребности в еде, сне, отдыхе, безопасности и т.п.'),(83,'Люблю создавать оригинальные идеи, необычные образы или способы действия '),(84,'Мне нравится жить '),(85,'Самостоятельно преодолеваю вредные привычки и развиваю положительные '),(86,'В трудных ситуациях стараюсь не вешать носа, проявлять жизнестойкость '),(87,'В делах проявляю инициативу, выдвигаю новые идеи '),(88,'С возрастом становлюсь терпимее к людям '),(89,'У меня есть знакомые, но нет друзей '),(90,'Планирую своё время и работу с учётом реальных условий и своих возможностей '),(91,'Стараюсь быть искренним, правдивым в общении '),(92,'Когда вижу, что незнакомому человеку плохо или трудно, всегда предлагаю свою помощь '),(93,'Обычно в делах я сосредоточен и собран '),(94,'Я – интересная личность '),(95,'В большинстве ситуаций стараюсь сохранять выдержку и уравновешенность '),(96,'Мне хочется глубже понять себя, людей и весь Мир '),(97,'Близко к сердцу принимаю страдания людей и животных '),(98,'Прикладываю усилия для поддержания хорошего физического и психического состояния '),(99,'Обычно действую по привычке, избегая новых целей и видов деятельности '),(100,'Умею создавать у себя хорошее настроение, находить способы его улучшения '),(101,'Последнее время у меня преобладает состояние апатии, нет сильных желаний '),(102,'Ощущаю себя гармоничным человеком, оптимально согласованным с собой и с внешним миром '),(103,'Я никогда не сержусь '),(104,'Стараюсь поддерживать хорошую физическую форму '),(105,'Меня беспокоит истребление редких животных и растений '),(106,'Стараюсь реалистично представлять себя и окружающий мир '),(107,'Созерцание красивого пейзажа улучшает моё настроение '),(108,'Подвергаю сомнению ничем не обоснованные представления о происхождении и устройстве Мира '),(109,'Меня радуют сделанные с любовью, красивые вещи '),(129,'Функция добавления вопроса');
